import React from 'react';
import kona from '../img/matt.jpg'

const Card = ({body, title, picture}) => {
	return(
		<div className="ma3 ba b--moon-gray br4 pa3 w-third">
			<img src={kona} alt="kona" className="br2"/>
			<h2 className="baskerville tc">{title}</h2>
			<ul className="list">
				<li>{body}</li>
			</ul>
		</div>
	);
};

export default Card;
